import React from "react";


export default function Semcard(props){
  return (
    <div className = "flex p-10 m-2 bg-white text-center font-bold  text-3xl b-2 border-blue-500">
      <h1 className="justify-center">{props.sem}</h1>
    </div>
  );
}
